import React, {Component} from 'react';
import { Switch, Route } from 'react-router-dom';
import Calculator from '../components/ListEmp';

class Main extends Component {
    render() {
    return (
        <main>
            <Switch>
                <Route exact path='/' Component={Calculator} />
            </Switch>
        </main>
    );
    }
    }
    export default Main;
